import './App.css';
import HomePage from './pages/HomePage';
import DataMahasiswaPage from './pages/DataMahasiswaPage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/" element={<DataMahasiswaPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
